import React from 'react';

export const Profile = ({url, des, name, job}) => {
    return (
        <div className='profile'>
                {url === null
            ? <h1>none!</h1>
            : <>
                <img className='photo' 
                src={url}
                alt={des}
                />
                <h1>{name}</h1>
                <p>{job}</p>
                </>
            }
    
            </div>
    )
};
